import styled from 'styled-components';

export const StyledPortrait = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 100%;
  padding: 20px;
`
export const StyledImage = styled.div`
  display: flex;
  height: 25%;
`

export const StyledLine = styled.div`
  display: flex;
  margin-top: -25px;
`
